VALUES (@parent_id, 0, 10 /* Tell */, 0, 1, NULL, 'Guard Swiftblade informs me that the Paradox-touched Olthoi Ward Guardian is presently alive and that the Wards protecting the Deeper Catacombs Portal are active.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (@parent_id, 1, 10 /* Tell */, 0, 1, NULL, 'He can direct you in how to find and defeat the Paradox-touched Olthoi Ward Guardian and bypass the Wards.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (@parent_id, 2, 10 /* Tell */, 0, 1, NULL, 'Once the Ward Guardian is dead, the portal to the Deeper Catacombs of the Paradox-touched Olthoi can be found within the upper area of the Black Death Catacombs.  Once you enter, seek the Sealed Olthoi Passage in the deepest parts of the Catacomb.  If you can get past the Passage, you''ll be able to get into the Paradox-touched Queen''s Lair.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (@parent_id, 3, 10 /* Tell */, 0, 1, NULL, 'I would hurry though, every time the Ward Guardian dies, it in some way returns six hours after its death, and the Wards return with it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);

